import React from "react";
import { Link } from "react-router-dom";

const races = [
  { id: 1, name: "Boston Marathon" },
  { id: 2, name: "Chicago Marathon" },
  { id: 3, name: "New York Marathon" },
];

function HomePage() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Bib Transfer Portal</h1>
      <ul>
        {races.map((race) => (
          <li key={race.id}>
            <Link to={`/chat/${race.id}`}>{race.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default HomePage;
